import React from 'react';
import { Container } from 'react-bootstrap'
import { Link } from 'react-router-dom'

const Home = () => {
    return (
        <Container>
            <Link to="/beers">
            <img src="" />
            <h4>All Beers</h4>
            <p></p>
            </Link>
        </Container>
    )
}

export default Home
